def max_gcd_for_banana_distribution(N, K):
    summ = K * (K + 1) / 2
    if K > 44720 or summ > N:
        return -1
    factors = []
    for i in range(1, int(math.sqrt(N)) + 1):
        if N % i == 0:
            factors.append(i)
            if i != N // i:
                factors.append(N // i)
    factors.sort()
    for factor in factors:
        if factor >= summ:
            return N // factor
    return -1

